import React from 'react';
import {Card, Provider as PaperProvider, TextInput} from "react-native-paper";
import {SafeAreaView} from "react-native";

const Login = () => {
    return (
        <SafeAreaView>
            <Card>
                <Card.Title title="Delivery"></Card.Title>
            </Card>
        </SafeAreaView>
    );
}

export default Login;
